import React, { Component } from 'react'

export default class Pomodoro extends Component {
  state = {

  }

  buttonStyle = () => {
    return ({
      fontSize: '1.5rem',
      fontStyle: 'italic',
      border: '2px solid white',
      padding: '10px 20px'
    });
  }

  render() {
    return (
      <div>
        <div style = { this.buttonStyle() }>
          Pomodoro
        </div>
        <span
          style = {{
            fontSize: '1rem',
            textAlign: 'center'
          }}
        >a collaborative effort with<br />Claire Sinozich</span>
      </div>
    )
  }
}
